import React from 'react';

class Form extends React.Component {
    constructor() {
        super();
        this.state = {
            firstName: 'Ada',
            lastName: 'Lovelace',
            birthDate: {
                day: 10,
                month: 'diciembre',
                year: 1815
            }
        }
    }
    render() {
        return (
            <div>
                <h2>Ejercício 06:</h2>
                <h3>Datos del usuário:</h3>
                <p>{this.state.firstName}</p>
                <p>{this.state.lastName}</p>
                <div>
                    <span>{`${this.state.birthDate.day}/`}</span>
                    <span>{`${this.state.birthDate.month}/`}</span>
                    <span>{this.state.birthDate.year}</span>
                </div>
            </div>
        );
    }
}

export default Form;
